//src/components/Timeline.js

import React from "react";
import "./Timeline.css";

const Timeline = () => {
  return (
    <div className="timeline-container">
      <div className="post">
        <p>Eu não sei vocês mas sei lá eu </p>
      </div>
      <div className="post">
        <p>
        isso de querer<br />
        ser exatamente aquilo<br />
        que a gente é<br />
        ainda vai<br />
        nos levar além<br /><br />

        </p>
      </div>
    </div>
  );
};

export default Timeline;
